import './App.css';
import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import HomePage from './HomePage';

const routes = [
  {
    path: '/',
    exact: true,
    navbar: HomePage,
    main: () => {
      <div>SOMETHING HERE</div>;
    },
  },
  {
    path: '/info',
    exact: true,
    navbar: HomePage,
    main: () => {
      <div>INFO</div>;
    },
  },
  {
    path: '/more',
    exact: true,
    navbar: HomePage,
    main: () => {
      <div>MORE STUFF</div>;
    },
  },
];

export default function App() {
  <Router>
    <div style={{ display: 'flex' }}>
      <ul style={{ listStyleType: 'none', padding: 0 }}>
        <li>
          <Link to='/'>Home</Link>
        </li>
        <li>
          <Link to='/info'>Bubblegum</Link>
        </li>
        <li>
          <Link to='/more'>Shoelaces</Link>
        </li>
      </ul>

      <Switch>
        {routes.map((route, index) => (
          <Route
            key={index}
            path={route.path}
            exact={route.exact}
            component={route.navbar}
          />
        ))}
      </Switch>
      <Switch>
        {routes.map((route, index) => (
          <Route
            key={index}
            path={route.path}
            exact={route.exact}
            component={route.main}
          />
        ))}
      </Switch>
    </div>
  </Router>;
}
